import React from "react";

const Loading = () => {
  return (
    <div className="loader">
  <div className="circle">
    <div className="dot"></div>
    <div className="outline"></div>
  </div>
  <div className="circle">
    <div className="dot"></div>
    <div className="outline"></div>
  </div>
  <div className="circle">
    <div className="dot"></div>
    <div className="outline"></div>
  </div>
  <div clasNames="circle">
    <div className="dot"></div>
    <div className="outline"></div>
  </div>
</div>
  );
};

export default Loading;
